import React from 'react';
import './Blayout.css'

const Blayout = () => {
	return(
     <div className = 'wrap' >
        <div className = 'header'>
           <div className = 'header-title'></div>
        </div>
        <ul className='list'>
        	<li className = 'list-name'>Barber Shop</li>
        	<li className = 'list-name'>Parlo Salon</li>
        	<li className = 'list-name'>Parlo Tatto</li>
        	<li className = 'list-name'>Others</li>
        </ul>
      </div>
	);
}

export default Blayout;
